import './search-bar.css'
import {Col, From,FromGroup} from "reactstrap";

const SearchBar = () => {
  return <Col lg='12'>
    <div className='search__bar'>
        <From className="d-flex align-items-center gap-4">
           
        </From>
    </div>
  </Col>
}

export default SearchBar;
